import Titulo from "../../components/TituloKenzie";
import { Container } from "./styles";

const Home = () => {



  return (
    <Container>
        <header><Titulo/></header>
        <figure><img src="https://images-na.ssl-images-amazon.com/images/I/71+mDoHG4mL.png" alt="user" /></figure>
    </Container>
  );
};

export default Home;
